1. First, calculate the total cost of the house after repairs:
   \begin{align*}
   80,000 + 50,000 &= 130,000
   \end{align*}
2. Next, determine the total profit by finding the difference between the increased value of the house and the total cost:
   \begin{align*}
   (\text{Increased Value}) - \text{Total Cost} &= 130,000 - 130,000 \\
   &= 0
   \end{align*}
3. Finally, calculate the profit by multiplying the increase percentage by the total cost:
   \begin{align*}
   150\% \times 130,000 &= 130,000 \times (0.15) \\
   &= 19,500
   \end{align*}
So, <question>What was the profit?</question>, the answer would be <answer>19,500</answer>

